import React, { Component } from 'react';
import Form from './Form.js';
import Cleanup from './Cleanup.js';

class App extends Component {
  render() {
    return (
      <div class="container">
        <div className="row">
          <h2>Leave your message here:</h2>
          <Form />
        </div>
        <div className="row">
          <h2>Clean Up</h2>
          <Cleanup />
        </div>
      </div>
    );
  }
}

export default App;
